import {Reset} from "styled-reset";
import {BouncingDiv, StartButton, Wrapper} from "./style";
import {useNavigate} from "react-router-dom";
import {useEffect, useState} from "react";

export default function Main() {

    const navigate = useNavigate();

    const onClickStartButton = () => {
        navigate('/first');
    }
    const [bounceDiv, setBounceDiv] = useState(false);
    const [bounceButton, setBounceButton] = useState(false);

    useEffect(() => {
        // 첫 번째 애니메이션 시작
        setBounceDiv(true);
        // 1초 후 두 번째 애니메이션 시작
        const timer = setTimeout(() => setBounceButton(true), 1000);
        return () => clearTimeout(timer);
    }, []);

    return (
        <>
            <Reset />
            <Wrapper>
                <BouncingDiv animate={bounceDiv}>
                    <svg width="650" height="400" viewBox="0 0 1124 602" fill="none" xmlns="http://www.w3.org/2000/svg">
                        <rect width="1124" height="602" fill="url(#pattern0_88_4)"/>
                        <defs>
                            <pattern id="pattern0_88_4" patternContentUnits="objectBoundingBox" width="1" height="1">
                                <use xlinkHref="#image0_88_4" transform="matrix(0.00107117 0 0 0.002 -0.0355872 0)"/>
                            </pattern>
                            <image id="image0_88_4" width="1000" height="500"
                                   xlinkHref="data:image/png;base64,"/>
                        </defs>
                    </svg>
                </BouncingDiv>
                <StartButton animate={bounceButton} onClick={onClickStartButton}>시작하기</StartButton>

            </Wrapper>
        </>
    );
}
